import "./App.css";
import { ProductInfo } from "./types";
import ProductPage from "./pages/ProductPage";

function App() {
  const product: ProductInfo[] = [
    { name: "Title 1", description: "Description 1", price: "10" },
    { name: "Title 2", description: "Description 2", price: "20" },
    { name: "Title 3", description: "Description 3", price: "30" },
  ];

  return (
    <>
      <ProductPage />
    </>
  );
}

export default App;
